from collections import deque

class FrontMiddleBackQueue:

    def __init__(self):
        self.queue = deque()

    def pushFront(self, val: int) -> None:
        self.queue.appendleft(val)

    def pushMiddle(self, val: int) -> None:
        idx = len(self.queue) // 2
        self.queue.insert(idx, val)

    def pushBack(self, val: int) -> None:
        self.queue.append(val)

    def popFront(self) -> int:
        return self.queue.popleft() if self.queue else -1

    def popMiddle(self) -> int:
        idx = (len(self.queue) - 1) // 2
        return self.queue.pop(idx) if self.queue else -1

    def popBack(self) -> int:
        return self.queue.pop() if self.queue else -1
